      array.push(<button></button>)
    }

    return array
  }

  return (
   
    <div className="options-container">
       <h4>using for-loop</h4>
      <Button 
        style={{
        top: "-150px",
        color:"#fff",
        width:"100px",
        height:"100px",
        borderColor: 'white',
        backgroundColor: "#5c5a5a",
        padding: "26px 26px",
        fontSize: "18px"
    }}
